// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;


contract Vote {
    struct Voter {
        bool voted;
        uint8 vote;
        uint32 weight;
        address delegate;
    }

    struct Proposal {
        bytes32 name;
        uint voteCount;
    }

    mapping (address => Voter) private voters;

    Proposal[] public proposals;

    address public chairman;

    constructor(bytes32[] memory _proposalNames) {
        chairman = msg.sender;
        voters[chairman].weight = 1;

        for (uint i = 0; i < _proposalNames.length ; i++) {
            proposals.push(Proposal({name: _proposalNames[i], voteCount: 0}));
        }
    }

    modifier onlyChairman() {
        require(chairman == msg.sender, "Only chairperson can give right to vote.");
        _;
    }

    modifier notYetVoted(address _voter) {
        require(!voters[_voter].voted, "The voter already voted.");
        _;
    }

    modifier noRightToVote(address _voter) {
        require(voters[_voter].weight == 0, "You have already a right to vote.");
        _;
    }

    function giveRightToVote(address _voter) external onlyChairman notYetVoted(_voter) noRightToVote(_voter){
        voters[_voter].weight = 1;
    }

}

